import { 
    SIGN_IN, 
    SIGN_OUT,
} from './types';

export const signIn = (userId) => {
    if(userId !== '108677919013990968799') {
        return {
            type: SIGN_IN,
            payload: userId,
            isAdmin: true
        }
    }
};

export const signOut = () => {
    return {
        type: SIGN_OUT
    };
};
